import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <form>
            <h1>Rock, Paper, or Scissors?</h1>
            <input id="playerSelection" type="text"/>
            <input value="Play" type="button" onClick="JavaScript:playRound()"/>
        </form>        
        <div id="result"></div>
    </div>
  );
}

export default App;
